function TodoItem(props) {
	return (
		<li className="TodoItem">
			<i
				className="fa-solid fa-circle-check fa-xl Icon Icon-"
				style={{ color: '#63E6BE' }}></i>

			<p>{props.text}</p>
			<i
				className="fa-regular fa-circle-xmark fa-lg"
				style={{ color: '#000000' }}></i>
		</li>
	);
}
export { TodoItem };
